import styled from "styled-components";

export const Wrapper = styled.div`
  text-align: center;
  width: 100%;
  position: absolute;
  top: 7.06rem;
`;

export const WakeupBox = styled.div`
  display: inline-block;
  height: 6.25rem;
  width: 21.875rem;
  border: 1px solid white;
  border-radius: 12px;
  background: #2d293d;
`;

export const SleepingComment = styled.div`
  text-align: left;
  margin-left: 0.75rem;
  margin-top: 0.63rem;
`;

export const SleepingHour = styled.span`
  color: #ffd954;
`;

export const NickNameText = styled.span`
  color: #fff;
  font-size: 1rem;
  font-style: normal;
  font-weight: 400;
  line-height: normal;
  letter-spacing: -0.24px;
  margin-top: 10px;
`;

export const Text = styled.span`
  color: #fff;
  font-size: 1rem;
  font-style: normal;
  font-weight: 400;
  line-height: normal;
  letter-spacing: -0.32px;
`;

export const WakeupSetting = styled.div`
  display: inline-flex;
  justify-content: center;
  gap: 4px;
  width: fit-content;
  height: auto;
  position: relative;


  span {
    color: var(--gray-4, #dbdbdb);
    font-size: 12px;
    font-style: normal;
    font-weight: 300;
    line-height: normal;
    letter-spacing: -0.24px;
  }
`;
